        [TestMethod]
        public void TestDecryptECB_1()
        {
            var expectedResult = @"captcha|imageword|txtspamcheck|turing";
            var decryptData = new DecryptData
            {
                password = @"artiartiartiartiartiartiartiarti",
                data = @"nsTHssUPa0l/BxycgOby0Dd1ExDlPB1udS0pFctL6nejJW31IhrU+elpAvfrGuhN",
                mode = Mode.ECB,
                b64 = true
            };
            var actual = Tools.Decrypt(decryptData);
            Console.WriteLine(actual);
            Assert.AreEqual(expectedResult, actual);
        }

